	/**
	 * 通过蓝牙连接发送普通通知消息
	 * @param context
	 * @param message
	 */
	public static void sendNormalMsgToBluetooth(Context context,String message){
		Intent intent = new Intent(WalkMessage.ACTION_UNIT_NORMAL_SEND);
    	intent.putExtra(WalkMessage.KEY_UNIT_MSG,message);
    	context.sendBroadcast( intent );
	}
	
	/**
	 * 获得当前测试过程中的无线参数信息
	 * @return
	 */
	public static String getParamsInfo(Context context){
		if(!ApplicationModel.getInstance().isTraceInitSucc()){
			return "";
		}
		Location gpsInfo = GpsInfo.getInstance().getLocation();
		
		StringBuffer sb = new StringBuffer();
		NetType nettype = MyPhoneState.getInstance().getCurrentNetType(context);
		sb.append("<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n\r");
		sb.append("<params  format =\"" + nettype.name() + "\"");
		sb.append("timestamp=\"" + UtilsMethod.sdFormat.format(System.currentTimeMillis()) + "\"\n\r");
		
		//拼GPS信息串
		sb.append(getGpsInfoStr());
		
		sb.append("<p name=\"GPS.LONG\">" 		+ (gpsInfo != null ? gpsInfo.getLongitude() : 0) + "</p>\n\r");
		sb.append("<p name=\"GPS.LAT\">" 		+ (gpsInfo != null ? gpsInfo.getLatitude() : 0) + "</p>\n\r");
		sb.append("<p name=\"GPS.VELOCITY\">" 	+ (gpsInfo != null ? gpsInfo.getSpeed() : 0) + "</p>\n\r");
		sb.append("<p name=\"GPS.ALTITUDE\">" 	+ (gpsInfo != null ? gpsInfo.getAltitude() : 0)+ "</p>\n\r");
		
		switch(nettype){
		case LTE:
		case LTETDD:
			DatasetManager.getInstance(context).queryParamsSync(PageQueryParas.OtsParamLte);
			DatasetManager.getInstance(context).queryCellSet(DataSetLib.EnumNetType.LTE);
			sb.append("<p name=\"LTE.RSRP\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.L_SRV_RSRP) + "</p>\n\r");
			sb.append("<p name=\"LTE.SINR\">"		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.L_SRV_SINR) + "</p>\n\r");
			sb.append("<p name=\"LTE.PCI\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.L_SRV_PCI) + "</p>\n\r");
			sb.append("<p name=\"LTE.TAC\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.L_SRV_TAC) + "</p>\n\r");
			sb.append("<p name=\"LTE.TM\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.L_SRV_TM) + "</p>\n\r");
			sb.append("<p name=\"LTE.RP_NCell\">" 	+ getLteRsrp() + "</p>\n\r");
			break;
		case TDSCDMA:
			DatasetManager.getInstance(context).queryParamsSync(PageQueryParas.OtsParamTdScdma);
			sb.append("<p name=\"TDS.PCCPCH_RSCP\">"+ TraceInfoInterface.getFloatParaValue(UnifyParaID.TD_Ser_PCCPCHRSCP) + "</p>\n\r");
			sb.append("<p name=\"TDS.PCCPCH_SIR\">" + TraceInfoInterface.getFloatParaValue(UnifyParaID.TD_Ser_PCCPCHSIR) + "</p>\n\r");
			sb.append("<p name=\"TDS.RXQUAL\">" 	+ TraceInfoInterface.getFloatParaValue(UnifyParaID.TD_Ser_PCCPCHC2I) + "</p>\n\r");
			sb.append("<p name=\"TDS.TA\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.TD_Ser_TA) + "</p>\n\r");
			sb.append("<p name=\"TDS.LAC\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.TD_Ser_LAC) + "</p>\n\r");
			sb.append("<p name=\"TDS.RAC\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.TD_Ser_RAC) + "</p>\n\r");
			sb.append("<p name=\"TDS.CID\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.TD_Ser_CellID) + "</p>\n\r");
			sb.append("<p name=\"TDS.RP_NCell\">" 	+ getTdscdmaRsrp() + "</p>\n\r");
			break;
		case GSM:
			DatasetManager.getInstance(context).queryParamsSync(PageQueryParas.OtsParamGsm);
			sb.append("<p name=\"GSM.RXLEV\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.G_Ser_RxLevFull) + "</p>\n\r");
			sb.append("<p name=\"GSM.C/I\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.G_Ser_TCH_C2I) + "</p>\n\r");
			sb.append("<p name=\"GSM.RXQUAL\">" 	+ TraceInfoInterface.getFloatParaValue(UnifyParaID.G_Ser_RxQualFull) + "</p>\n\r");
			sb.append("<p name=\"GSM.TA\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.G_Ser_TA) + "</p>\n\r");
			sb.append("<p name=\"GSM.LAC\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.G_Ser_LAC) + "</p>\n\r");
			sb.append("<p name=\"GSM.RAC\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.G_Ser_RAC) + "</p>\n\r");
			sb.append("<p name=\"GSM.CID\">" 		+ TraceInfoInterface.getFloatParaValue(UnifyParaID.G_Ser_Cell_ID) + "</p>\n\r");
			sb.append("<p name=\"GSM.RP_NCell\">" 	+ getGsmRxLevels() + "</p>\n\r");
			break;
		default:
			break;
		}
		
		return sb.toString();
	}
	
	/**
	 * 中果当前经纬度对象不为null返回经纬度信息
	 * @return
	 */
	private static String getGpsInfoStr(){
		StringBuffer sb = new StringBuffer();
		Location local = GpsInfo.getInstance().getLocation();
		if(local != null){
			sb.append("<p name=\"GPS.LONG\">" 		+ local.getLongitude() 	+ "</p>\n\r");
			sb.append("<p name=\"GPS.LAT\">" 		+ local.getLatitude() 	+ "</p>\n\r");
			sb.append("<p name=\"GPS.VELOCITY\">" 	+ local.getSpeed() 		+ "</p>\n\r");
			sb.append("<p name=\"GPS.ALTITUDE\">" 	+ local.getAltitude() 	+ "</p>\n\r");
		}
		
		return sb.toString();
	}
	
	/**
	 * 获得LTE邻区RSRP列表
	 * @return
	 */
	private static String getLteRsrp(){
		String[] ltes = TraceInfoInterface.getParaValue(UnifyParaID.LTE_CELL_LIST).split(";");
		String rsrpResult = "";
		for(int i= 1; i< ltes.length; i++){
			String[] ltefs = ltes[i].split(",");
			if(ltefs.length > 3){
				rsrpResult += (i != 1 ? "," : "") + ltefs[2];
			}
		}
		return rsrpResult;
	}
	
