	/**
	 * 获得当前设备的相关版本信息
	 * @return
	 */
	public static String getDeviceInfo(Context _context){
		StringBuffer sb = new StringBuffer();
		MyPhoneState myPhoneState = MyPhoneState.getInstance();
		sb.append("<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n\r");
		sb.append("<params ");
		sb.append("timestamp=\"" + UtilsMethod.sdFormat.format(System.currentTimeMillis()) 								+ "\" >\n\r");
		try{
			sb.append("<p name=\"DEV.NAME\">" 			+ android.os.Build.MODEL 										+ "</p>\n\r");
			sb.append("<p name=\"DEV.IMSI\">" 			+ myPhoneState.getIMSI(_context) 								+ "</p>\n\r");
			sb.append("<p name=\"DEV.IMEI\">" 			+ myPhoneState.getIMEI(_context) 								+ "</p>\n\r");
			sb.append("<p name=\"DEV.MAC\">" 			+ myPhoneState.getLocalMacAddress(_context)						+ "</p>\n\r");
			sb.append("<p name=\"DEV.ATPORT\">COM2</p>\n\r");
			sb.append("<p name=\"DEV.VERSION\">"		+ myPhoneState.getAndroidVersion() 								+"</p>\n\r");
			sb.append("<p name=\"DEV.MTMSI\">0</p>\n\r");
			APNModel apn = APNOperate.getInstance(_context).getCurrentApn();
			if(apn != null)
				sb.append("<p name=\"DEV.APN\">"			+ apn.getName()	+ "</p>\n\r");
			else
				sb.append("<p name=\"DEV.APN\">CMNET</p>\n\r");
			sb.append("<p name=\"DEV.IPV4\">" 			+ myPhoneState.getLocalIpv4Address() 							+ "</p>\n\r");
			sb.append("<p name=\"DEV.IPV6\">" 			+ myPhoneState.getLocalIpv4Address()	 						+ "</p>\n\r");
			sb.append("<p name=\"FIRMWARE.VERSION\">"	+ myPhoneState.getBaseBandVersion() 							+ "</p>\n\r");
			sb.append("<p name=\"VENDOR.ID\">0x01</p>\n\r");
			sb.append("<p name=\"VENDOR.VER\">"  +  UtilsMethod.getCurrentVersionName(_context) +  "</p>\n\r");
		}catch(Exception e){
			e.printStackTrace();
		}
		
		sb.append("</params>");
		return sb.toString();
	}
	
